INSERT INTO blog_post VALUES(3,'New Title','Post body.','2024-10-19 20:48:47','2024-10-19 20:48:47.834436','2024-11-09 18:06:54.461195',2,'PB','another-post');
INSERT INTO blog_post VALUES(4,'Welcome to Flavor Haven: Your New Go-To Recipe Destination',replace(replace('Are you a foodie at heart, always on the lookout for fresh and exciting recipes? Do you love exploring diverse cuisines or need quick and delicious weeknight meals? Welcome to Flavor Haven, a recipe website built to inspire your inner chef! Here, we believe cooking should be accessible, enjoyable, and full of flavor for everyone—no matter your skill level.\r\n\r\nAt Flavor Haven, you’ll find a carefully curated selection of recipes, from comforting classics to innovative dishes that bring global flavors to your kitchen. Our step-by-step instructions make it easy to cook with confidence, and our user-friendly features let you filter by dietary preferences, cuisine types, preparation time, and skill level.\r\n\r\nStay tuned for chef tips, ingredient guides, and meal-planning resources to keep your culinary journey exciting and hassle-free. So grab your apron and join us at Flavor Haven, where every recipe is a chance to create, taste, and share something delicious!','\r',char(13)),'\n',char(10)),'2024-10-27 21:48:45','2024-10-27 21:50:06.897807','2024-10-27 21:50:06.897823',2,'PB','welcome-to-flavor-haven-your-new-go-to-recipe-destination');
INSERT INTO blog_recipe VALUES(1,'Classic Homemade Waffles','classic-homemade-waffles',replace(replace('These waffles are crispy on the outside, fluffy on the inside, and perfect for breakfast or brunch!\r\n\r\nServe warm with your favorite toppings like fresh berries, syrup, or whipped cream!\r\n\r\nEnjoy your homemade waffles!','\r',char(13)),'\n',char(10)),replace(replace('1 ¾ cups all-purpose flour\r\n2 tablespoons sugar\r\n1 tablespoon baking powder\r\n½ teaspoon salt\r\n2 large eggs\r\n1 ¾ cups milk\r\n½ cup vegetable oil or melted butter\r\n1 teaspoon vanilla extract','\r',char(13)),'\n',char(10)),4,'2024-10-27 21:50:53','2024-10-27 21:52:16.495783','2024-10-27 23:32:26.906398',1,replace(replace('Preheat your waffle iron according to the manufacturer’s instructions.\r\nWhisk together the flour, sugar, baking powder, and salt in a large bowl.\r\nIn a separate bowl, beat the eggs and add the milk, oil (or melted butter), and vanilla. Mix well.\r\nCombine the wet ingredients with the dry ingredients, stirring just until smooth (a few lumps are okay).\r\nPour about ½ cup of batter onto the preheated waffle iron, spreading it evenly.\r\nCook until golden brown and crisp, typically 3–5 minutes, depending on your waffle iron.','\r',char(13)),'\n',char(10)));
